(27, 1, 'canned.2', 'Hi %{ticket.name.first}, <br /> <br /> Your ticket #%{ticket.number} created on %{ticket.create_date} is in %{ticket.dept.name} department.', '2017-07-30 08:24:34', '2017-07-30 08:24:43'),
(29, 1, 'tpl.staff.pwreset.1', '<h3><strong>Hi %{staff.name.first},</strong></h3> A password reset request has been submitted on your behalf for the Lagos State University helpdesk at %{url}. <br /> <br /> If you feel that this has been done in error, delete and disregard this email. Your account is still secure and no one has been given access to it. It is not locked and your password has not been reset. Someone could have mistakenly entered your email address. <br /> <br /> Follow the link below to login to the help desk and change your password. <br /> <br /> <a href="%{reset_link}">%{reset_link}</a> <br /> <br /> <em style="font-size: small">Your friendly Customer Support System</em> <br /> <a href="http://lasu.edu.ng" target="_blank"></a><a href="http://lasu.edu.ng" target="_blank"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Lagos State University ICTC" width="146" height="22" style="width: 146px" /></a>', '2017-07-30 08:53:00', '2017-07-30 08:53:11'),
(30, 1, 'tpl.user.accesslink.1', '<h3><strong>Hi %{recipient.name.first},</strong></h3> An access link request for ticket #%{ticket.number} has been submitted on your behalf for the helpdesk at %{url}. <br /> <br /> Follow the link below to check the status of the ticket #%{ticket.number}. <br /> <br /> <a href="%{recipient.ticket_link}">%{recipient.ticket_link}</a> <br /> <br />If you <strong>did not</strong> make the request, please delete and disregard this email. Your account is still secure and no one has been given access to the ticket. Someone could have mistakenly entered your email address. <br /> <br /> --<br /> %{company.name}', '2017-07-30 08:53:15', '2017-07-30 08:53:41'),
(32, 1, 'tpl.note.alert.1', '<h3><strong>Hi %{recipient.name},</strong></h3> An internal note has been appended to ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> <br /> <br /> <table> <tbody> <tr> <td> <strong>From</strong>: </td> <td> %{note.poster} </td> </tr> <tr> <td> <strong>Title</strong>: </td> <td> %{note.title} </td> </tr> </tbody> </table> <br /> %{note.message} <br /> <br /> <hr /> To view/respond to the ticket, please <a href="%{ticket.staff_link}">login</a> to the support ticket system <br /> <br /> <em style="font-size: small">Your friendly Customer Support System</em> <br /> <a href="http://lasu.edu.ng"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Powered by Lagos State University ICTC" width="126" height="19" style="width: 126px" /></a>', '2017-07-30 08:56:27', NULL),
(34, 1, 'tpl.message.alert.1', '<h3><strong>Hi %{recipient.name},</strong></h3> New message appended to ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> <br /> <br /> <table> <tbody> <tr> <td> <strong>From</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr> <tr> <td> <strong>Department</strong>: </td> <td> %{ticket.dept.name} </td> </tr> </tbody> </table> <br /> %{message} <br /> <br /> <hr /> <div>To view or respond to the ticket, please <a href="%{ticket.staff_link}"><span style="color: rgb(84, 141, 212)">login</span></a> to the support ticket system</div> <em style="color: rgb(127,127,127); font-size: small">Your friendly Customer Support System</em><br /> <a href="http://lasu.edu.ng"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Powered by Lagos State University ICTC" width="126" height="19" style="width: 126px" /></a>', '2017-07-30 08:57:58', '2017-07-30 08:58:08'),
(36, 1, 'tpl.ticket.alert.1', '<h2>Hi %{recipient.name},</h2> New ticket #%{ticket.number} created <br /> <br /> <table> <tbody> <tr> <td> <strong>From</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr> <tr> <td> <strong>Department</strong>: </td> <td> %{ticket.dept.name} </td> </tr> </tbody> </table> <br /> %{message} <br /> <br /> <hr /> <div>To view or respond to the ticket, please <a href="%{ticket.staff_link}">login</a> to the support ticket system</div> <em style="font-size: small">Your friendly Customer Support System</em> <br /> <a href="http://lasu.edu.ng" target="_blank"><img width="126" height="19" style="width: 126px" alt="Powered By Lagos State University ICTC" src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" /></a>', '2017-07-30 08:59:18', NULL),
(38, 1, 'tpl.ticket.overdue.1', '<h3><strong>Hi %{recipient.name}</strong>,</h3> A ticket, <a href="%{ticket.staff_link}">#%{ticket.number}</a> is seriously overdue. <br /> <br /> We should all work hard to guarantee that all tickets are being addressed in a timely manner. <br /> <br /> Signed,<br /> %{ticket.dept.manager.name} <hr /> <div>To view or respond to the ticket, please <a href="%{ticket.staff_link}"><span style="color: rgb(84, 141, 212)">login</span></a> to the support ticket system. You''re receiving this notice because the ticket is assigned directly to you or to a team or department of which you''re a member.</div> <em style="font-size: small">Your friendly <span style="font-size: smaller">(although with limited patience)</span> Customer Support System</em><br /> <a href="http://lasu.edu.ng" target="_blank"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" height="19" alt="Powered by Lagos State University ICTC" width="126" style="width: 126px" /></a>', '2017-07-30 09:00:55', NULL),
(39, 1, 'tpl.ticket.overdue.1', '<h3><strong>Hi %{recipient.name}</strong>,</h3> A ticket, <a href="%{ticket.staff_link}">#%{ticket.number}</a> is seriously overdue. <br /> <br /> We should all work hard to guarantee that all tickets are being addressed in a timely manner. <br /> <br /> Signed,<br /> %{ticket.dept.manager.name} <hr /> <div>To view or respond to the ticket, please <a href="%{ticket.staff_link}"><span style="color: rgb(84, 141, 212)">login</span></a> to the support ticket system. You''re receiving this notice because the ticket is assigned directly to you or to a team or department of which you''re a member.</div> <em style="font-size: small">Your friendly <span style="font-size: smaller">(although with limited patience)</span> Customer Support System</em><br /> <a href="http://lasu.edu.ng" target="_blank"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" height="19" alt="Powered by Lagos State University ICTC" width="126" style="width: 126px" /></a>', '2017-07-30 09:00:59', NULL),
(41, 1, 'tpl.assigned.alert.1', '<h3><strong>Hi %{assignee.name.first},</strong></h3> Ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> has been assigned to you by %{assigner.name.short} <br /> <br /> <table> <tbody> <tr> <td> <strong>From</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr> <tr> <td> <strong>Subject</strong>: </td> <td> %{ticket.subject} </td> </tr> </tbody> </table> <br /> %{comments} <br /> <br /> <hr /> <div>To view/respond to the ticket, please <a href="%{ticket.staff_link}"><span style="color: rgb(84, 141, 212)">login</span></a> to the support ticket system</div> <em style="font-size: small">Your friendly Customer Support System</em> <br /> <a href="http://lasu.edu.ng" target="_blank"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Powered by Lagos State University ICTC" width="126" height="19" style="width: 126px" /></a>', '2017-07-30 09:04:15', '2017-07-30 09:04:24'),
(43, 1, 'tpl.transfer.alert.1', '<h3>Hi %{recipient.name},</h3> Ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> has been transferred to the %{ticket.dept.name} department by <strong>%{staff.name.short}</strong> <br /> <br /> <blockquote><div> %{comments} </div></blockquote> <hr /> <div>To view or respond to the ticket, please <a href="%{ticket.staff_link}">login</a> to the support ticket system. </div> <em style="font-size: small">Your friendly Customer Support System</em> <br /> <a href="http://osticket.com/" target="_blank"><img width="126" height="19" alt="Powered By Lagos State University ICTC" style="width: 126px" src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" /></a>', '2017-07-30 09:05:29', '2017-07-30 09:05:42'),
(44, 1, 'tpl.ticket.activity.notice.1', '<h3><strong>Dear %{recipient.name.first},</strong></h3> <div> <em>%{poster.name}</em> just logged a message to a ticket in which you participate. </div> <br /> %{message} <br /> <br /> <hr /> <div style="color: rgb(127, 127, 127); font-size: small; text-align: center"> <em>You''re getting this email because you are a collaborator on ticket <a href="%{recipient.ticket_link}" style="color: rgb(84, 141, 212)">#%{ticket.number}</a>. To participate, simply reply to this email or <a href="%{recipient.ticket_link}" style="color: rgb(84, 141, 212)">click here</a> for a complete archive of the ticket thread.</em> </div>', '2017-07-30 09:05:45', '2017-07-30 09:05:54'),
(45, 1, 'tpl.message.autoresp.1', '<h3><strong>Dear %{recipient.name.first},</strong></h3> Your reply to support request <a href="%{recipient.ticket_link}">#%{ticket.number}</a> has been noted <br /> <br /> <div style="color: rgb(127, 127, 127)"> Your %{company.name} Team,<br /> %{signature} </div> <hr /> <div style="color: rgb(127, 127, 127); font-size: small; text-align: center"><em>You can view the support request progress <a href="%{recipient.ticket_link}">online here</a></em> </div>', '2017-07-30 09:07:04', '2017-07-30 09:07:12'),
(47, 1, 'tpl.ticket.autoreply.1', '<h3><strong>Dear %{recipient.name.first},</strong></h3> A request for support has been created and assigned ticket <a href="%{recipient.ticket_link}">#%{ticket.number}</a> with the following automatic reply <br /> <br /> Topic: <strong>%{ticket.topic.name}</strong> <br /> Subject: <strong>%{ticket.subject}</strong> <br /> <br /> %{response} <br /> <br /> <div style="color: rgb(127, 127, 127)">Your %{company.name} Team,<br /> %{signature}</div> <hr /> <div style="color: rgb(127, 127, 127); font-size: small"><em>We hope this response has sufficiently answered your questions. If you wish to provide additional comments or information, please reply to this email or <a href="%{recipient.ticket_link}"><span style="color: rgb(84, 141, 212)">login to your account</span></a> for a complete archive of your support requests.</em></div>', '2017-07-30 09:07:47', NULL),
(48, 1, 'tpl.ticket.autoresp.1', '<h3><strong>Dear %{recipient.name.first},</strong></h3> Our customer care team has created a ticket, <a href="%{recipient.ticket_link}">#%{ticket.number}</a> on your behalf, with the following details and summary: <br /> <br /> Subject: <strong>%{ticket.subject}</strong><br /> Submitted: <strong>%{ticket.create_date}</strong> <br /> <br /> %{message} <br /> <br /> A representative will follow-up with you as soon as possible. You can <a href="%{recipient.ticket_link}">view this ticket''s progress online</a>. <br /> <br /> <div style="color: rgb(127, 127, 127)"> Your %{company.name} Team, <br /> %{signature} </div> <hr /> <div style="color: rgb(127, 127, 127); font-size: small"><em>If you wish to provide additional comments or information regarding the issue, please reply to this email or <a href="%{recipient.ticket_link}"><span style="color: rgb(84, 141, 212)">login to your account</span></a> for a complete archive of your support requests.</em></div>', '2017-07-30 09:07:55', '2017-07-30 09:08:04'),
(49, 1, 'tpl.ticket.notice.1', '<h3><strong>Dear %{recipient.name.first},</strong></h3> Our customer care team has created a ticket, <a href="%{recipient.ticket_link}">#%{ticket.number}</a> on your behalf, with the following details and summary: <br /> <br /> Topic: <strong>%{ticket.topic.name}</strong> <br /> Subject: <strong>%{ticket.subject}</strong> <br /> <br /> %{message} <br /> <br /> If need be, a representative will follow-up with you as soon as possible. You can also <a href="%{recipient.ticket_link}">view this ticket''s progress online</a>. <br /> <br /> <div style="color: rgb(127, 127, 127)"> Your %{company.name} Team,<br /> %{signature}</div> <hr /> <div style="color: rgb(127, 127, 127); font-size: small"><em>If you wish to provide additional comments or information regarding the issue, please reply to this email or <a href="%{recipient.ticket_link}"><span style="color: rgb(84, 141, 212)">login to your account</span></a> for a complete archive of your support requests.</em></div>', '2017-07-30 09:08:08', '2017-07-30 09:08:17'),
(50, 1, 'tpl.ticket.overlimit.1', '<h3><strong>Dear %{ticket.name.first},</strong></h3> You have reached the maximum number of open tickets allowed. To be able to open another ticket, one of your pending tickets must be closed. To update or add comments to an open ticket simply <a href="%{url}/tickets.php?e=%{ticket.email}">login to our helpdesk</a>. <br /> <br /> Thank you,<br /> Support Ticket System', '2017-07-30 09:08:21', NULL),
(51, 1, 'tpl.ticket.reply.1', '<h3><strong>Dear %{recipient.name},</strong></h3> %{response} <br /> <br /> <div style="color: rgb(127, 127, 127)"> Your %{company.name} Team,<br /> %{signature} </div> <hr /> <div style="color: rgb(127, 127, 127); font-size: small; text-align: center"><em>We hope this response has sufficiently answered your questions. If not, please do not send another email. Instead, reply to this email or <a href="%{recipient.ticket_link}" style="color: rgb(84, 141, 212)">login to your account</a> for a complete archive of all your support requests and responses.</em></div>', '2017-07-30 09:08:28', '2017-07-30 09:08:37'),
