(1, 1, 'ticket.autoresp', 'Support Ticket Opened [#%{ticket.number}]', '<h3><strong>Dear %{recipient.name.first},</strong></h3> Our customer care team has created a ticket, <a href="%{recipient.ticket_link}">#%{ticket.number}</a> on your behalf, with the following details and summary: <br /> <br /> Subject: <strong>%{ticket.subject}</strong><br /> Submitted: <strong>%{ticket.create_date}</strong> <br /> <br /> %{message} <br /> <br /> A representative will follow-up with you as soon as possible. You can <a href="%{recipient.ticket_link}">view this ticket''s progress online</a>. <br /> <br /> <div style="color: rgb(127, 127, 127)"> Your %{company.name} Team, <br /> %{signature} </div> <hr /> <div style="color: rgb(127, 127, 127); font-size: small"><em>If you wish to provide additional comments or information regarding the issue, please reply to this email or <a href="%{recipient.ticket_link}"><span style="color: rgb(84, 141, 212)">login to your account</span></a> for a complete archive of your support requests.</em></div>', NULL, '2014-07-13 12:13:30', '2014-07-13 12:13:30'),
(2, 1, 'ticket.autoreply', 'Re: %{ticket.subject} [#%{ticket.number}]', '<h3><strong>Dear %{recipient.name.first},</strong></h3> A request for support has been created and assigned ticket <a href="%{recipient.ticket_link}">#%{ticket.number}</a> with the following automatic reply <br /> <br /> Topic: <strong>%{ticket.topic.name}</strong> <br /> Subject: <strong>%{ticket.subject}</strong> <br /> <br /> %{response} <br /> <br /> <div style="color: rgb(127, 127, 127)">Your %{company.name} Team,<br /> %{signature}</div> <hr /> <div style="color: rgb(127, 127, 127); font-size: small"><em>We hope this response has sufficiently answered your questions. If you wish to provide additional comments or information, please reply to this email or <a href="%{recipient.ticket_link}"><span style="color: rgb(84, 141, 212)">login to your account</span></a> for a complete archive of your support requests.</em></div>', NULL, '2014-07-13 12:13:30', '2017-07-30 03:07:45'),
(3, 1, 'message.autoresp', 'Message Confirmation', '<h3><strong>Dear %{recipient.name.first},</strong></h3> Your reply to support request <a href="%{recipient.ticket_link}">#%{ticket.number}</a> has been noted <br /> <br /> <div style="color: rgb(127, 127, 127)"> Your %{company.name} Team,<br /> %{signature} </div> <hr /> <div style="color: rgb(127, 127, 127); font-size: small; text-align: center"><em>You can view the support request progress <a href="%{recipient.ticket_link}">online here</a></em> </div>', NULL, '2014-07-13 12:13:30', '2014-07-13 12:13:30'),
(4, 1, 'ticket.notice', '%{ticket.subject} [#%{ticket.number}]', '<h3><strong>Dear %{recipient.name.first},</strong></h3> Our customer care team has created a ticket, <a href="%{recipient.ticket_link}">#%{ticket.number}</a> on your behalf, with the following details and summary: <br /> <br /> Topic: <strong>%{ticket.topic.name}</strong> <br /> Subject: <strong>%{ticket.subject}</strong> <br /> <br /> %{message} <br /> <br /> If need be, a representative will follow-up with you as soon as possible. You can also <a href="%{recipient.ticket_link}">view this ticket''s progress online</a>. <br /> <br /> <div style="color: rgb(127, 127, 127)"> Your %{company.name} Team,<br /> %{signature}</div> <hr /> <div style="color: rgb(127, 127, 127); font-size: small"><em>If you wish to provide additional comments or information regarding the issue, please reply to this email or <a href="%{recipient.ticket_link}"><span style="color: rgb(84, 141, 212)">login to your account</span></a> for a complete archive of your support requests.</em></div>', NULL, '2014-07-13 12:13:30', '2014-07-13 12:13:30'),
