(11, 1, 'assigned.alert', 'Ticket Assigned to you', '<h3><strong>Hi %{assignee.name.first},</strong></h3> Ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> has been assigned to you by %{assigner.name.short} <br /> <br /> <table> <tbody> <tr> <td> <strong>From</strong>: </td> <td> %{ticket.name} &lt;%{ticket.email}&gt; </td> </tr> <tr> <td> <strong>Subject</strong>: </td> <td> %{ticket.subject} </td> </tr> </tbody> </table> <br /> %{comments} <br /> <br /> <hr /> <div>To view/respond to the ticket, please <a href="%{ticket.staff_link}"><span style="color: rgb(84, 141, 212)">login</span></a> to the support ticket system</div> <em style="font-size: small">Your friendly Customer Support System</em> <br /> <a href="http://lasu.edu.ng" target="_blank"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Powered by Lagos State University ICTC" width="126" height="19" style="width: 126px" /></a>', NULL, '2014-07-13 12:13:31', '2017-07-30 03:04:09'),
(12, 1, 'transfer.alert', 'Ticket #%{ticket.number} transfer - %{ticket.dept.name}', '<h3>Hi %{recipient.name},</h3> Ticket <a href="%{ticket.staff_link}">#%{ticket.number}</a> has been transferred to the %{ticket.dept.name} department by <strong>%{staff.name.short}</strong> <br /> <br /> <blockquote><div> %{comments} </div></blockquote> <hr /> <div>To view or respond to the ticket, please <a href="%{ticket.staff_link}">login</a> to the support ticket system. </div> <em style="font-size: small">Your friendly Customer Support System</em> <br /> <a href="http://osticket.com/" target="_blank"><img width="126" height="19" alt="Powered By Lagos State University ICTC" style="width: 126px" src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" /></a>', NULL, '2014-07-13 12:13:31', '2017-07-30 03:05:26'),
(13, 1, 'ticket.overdue', 'Stale Ticket Alert', '<h3><strong>Hi %{recipient.name}</strong>,</h3> A ticket, <a href="%{ticket.staff_link}">#%{ticket.number}</a> is seriously overdue. <br /> <br /> We should all work hard to guarantee that all tickets are being addressed in a timely manner. <br /> <br /> Signed,<br /> %{ticket.dept.manager.name} <hr /> <div>To view or respond to the ticket, please <a href="%{ticket.staff_link}"><span style="color: rgb(84, 141, 212)">login</span></a> to the support ticket system. You''re receiving this notice because the ticket is assigned directly to you or to a team or department of which you''re a member.</div> <em style="font-size: small">Your friendly <span style="font-size: smaller">(although with limited patience)</span> Customer Support System</em><br /> <a href="http://lasu.edu.ng" target="_blank"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" height="19" alt="Powered by Lagos State University ICTC" width="126" style="width: 126px" /></a>', NULL, '2014-07-13 12:13:31', '2017-07-30 03:00:45'),
(14, 1, 'staff.pwreset', 'Lagos State University Staff Password Reset', '<h3><strong>Hi %{staff.name.first},</strong></h3> A password reset request has been submitted on your behalf for the Lagos State University helpdesk at %{url}. <br /> <br /> If you feel that this has been done in error, delete and disregard this email. Your account is still secure and no one has been given access to it. It is not locked and your password has not been reset. Someone could have mistakenly entered your email address. <br /> <br /> Follow the link below to login to the help desk and change your password. <br /> <br /> <a href="%{reset_link}">%{reset_link}</a> <br /> <br /> <em style="font-size: small">Your friendly Customer Support System</em> <br /> <a href="http://lasu.edu.ng" target="_blank"></a><a href="http://lasu.edu.ng" target="_blank"><img src="cid:b56944cb4722cc5cda9d1e23a3ea7fbc" alt="Lagos State University ICTC" width="146" height="22" style="width: 146px" /></a>', NULL, '2014-07-13 12:13:31', '2017-07-30 02:52:56'),
(15, 1, 'user.accesslink', 'Ticket [#%{ticket.number}] Access Link', '<h3><strong>Hi %{recipient.name.first},</strong></h3> An access link request for ticket #%{ticket.number} has been submitted on your behalf for the helpdesk at %{url}. <br /> <br /> Follow the link below to check the status of the ticket #%{ticket.number}. <br /> <br /> <a href="%{recipient.ticket_link}">%{recipient.ticket_link}</a> <br /> <br />If you <strong>did not</strong> make the request, please delete and disregard this email. Your account is still secure and no one has been given access to the ticket. Someone could have mistakenly entered your email address. <br /> <br /> --<br /> %{company.name}', NULL, '2014-07-13 12:13:31', '2014-07-13 12:13:31');

