(1, 1, 'landing', 'Landing', '<h1>Welcome to the Support Center</h1>\n<p>\nIn order to streamline support requests and better serve you, we utilize\na support ticket system. Every support request is assigned a unique\nticket number which you can use to track the progress and responses\nonline. For your reference we provide complete archives and history of\nall your support requests. A valid email address is required to submit a\nticket.\n</p>', 'en_US', 'The landing page is served on the front page of the customer portal\nabove the two links for creating new tickets and viewing ticket status.', '2014-07-13 12:13:28', '2014-07-13 12:13:28'),
(2, 1, 'thank-you', 'Thank You', '<div>%{ticket.name},\n<br>\n<br>\nThank you for contacting us.\n<br>\n<br>\nA support ticket request has been created and a representative will be\ngetting back to you shortly if necessary.</p>\n<br>\n<br>\nSupport Team\n</div>', 'en_US', 'The thank-you page is served to the customer portal when a user submites\na new ticket via the customer portal.', '2014-07-13 12:13:29', '2014-07-13 12:13:29'),
(3, 1, 'offline', 'Offline', '<div><h1>\n<span style="font-size: medium">Support Ticket System Offline</span>\n</h1>\n<p>Thank you for your interest in contacting us.</p>\n<p>Our helpdesk is offline at the moment, please check back at a later\ntime.</p>\n</div>', 'en_US', 'The offline page is served to the customer portal when the help desk is\nconfigured offline in the Admin Panel', '2014-07-13 12:13:29', '2014-07-13 12:13:29');

